import   logo from './Images/thestory.jpg';
import './work.css';
import second from './Images/final_00002.jpg';
import third from './Images/final_00003.jpg';
import four from './Images/final_00004.jpg';
import five from './Images/final_00005.jpg';
import six from './Images/final_00006.jpg';
import seven from './Images/final_00007.jpg';
import eight from './Images/final_00008.jpg';
import nine from './Images/final_00009.jpg';
import ten from './Images/final_00010.jpg';
import ele from './Images/final_00011.jpg';
import tw from './Images/final_00012.jpg';
import thir from './Images/final_00013.jpg';
import fourt from './Images/final_00014.jpg';
import fiveteen from './Images/final_00015.jpg';
import sixteen from './Images/final_00016.jpg';
import seventeen from './Images/final_00017.jpg';
import eighteen from './Images/final_00018.jpg';
import nineteen from './Images/final_00019.jpg';
import twenty from './Images/final_00020.jpg';
import twenty1 from './Images/final_00021.jpg';
import twenty2 from './Images/final_00022.jpg';




function Work(){
    return(<div>

        <section >

            <div >
            
            <img className="the-story"  src={logo} alt="React Logo" />
            <img className="the-story"  src={second} alt="React Logo" />
            <img className="the-story"  src={third} alt="React Logo" />
            <img className="the-story"  src={four} alt="React Logo" />
            <img className="the-story"  src={five} alt="React Logo" />
            <img className="the-story"  src={six} alt="React Logo" />
            <img className="the-story"  src={seven} alt="React Logo" />
            <img className="the-story"  src={eight} alt="React Logo" />
            <img className="the-story"  src={nine} alt="React Logo" />
            <img className="the-story"  src={ten} alt="React Logo" />
            <img className="the-story"  src={ele} alt="React Logo" />
            <img className="the-story"  src={tw} alt="React Logo" />
            <img className="the-story"  src={thir} alt="React Logo" />
            <img className="the-story"  src={fourt} alt="React Logo" />
            <img className="the-story"  src={fiveteen} alt="React Logo" />
            <img className="the-story"  src={sixteen} alt="React Logo" />
            <img className="the-story"  src={seventeen} alt="React Logo" />
            <img className="the-story"  src={eighteen} alt="React Logo" />
            <img className="the-story"  src={nineteen} alt="React Logo" />
            <img className="the-story"  src={twenty} alt="React Logo" />
            <img className="the-story"  src={twenty1} alt="React Logo" />
            <img className="the-story"  src={twenty2} alt="React Logo" />
            

            </div>
        
       

         
        </section>

    </div>)
}

export default Work;
